import React from 'react';

interface PlaidLinkButtonProps {
  onSuccess: (linked: any[]) => void;
}

export function PlaidLinkButton({ onSuccess }: PlaidLinkButtonProps) {
  const handleClick = () => {
    // For now, simulate Plaid success with mock data
    const mockAccount = {
      id: crypto.randomUUID(),
      type: 'checking' as const,
      name: 'Sandbox Checking',
      balance: 0
    };
    
    onSuccess([mockAccount]);
  };

  return (
    <button className="connect-button primary" onClick={handleClick}>
      Connect with Plaid
    </button>
  );
}
